import React from "react";
import LoremIpsum from "../../loremIpsum";
import GrayImg from "../../shared/gray_img";

const Planet = (props) => {
   return(
       <div>
            <h4>{props.nome}</h4>  
            <p>{props.description}</p>
            <GrayImg img_url={props.im}/>
        </div>
   ) 
}

export default Planet;
